import React, { useEffect, useState } from "react";
import axios from "axios";
import MapComponent from "./components/MapComponent";

function App() {
  const [cars, setCars] = useState([]);
  const [selectedCar, setSelectedCar] = useState(null);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Kiểm tra nếu người dùng đã đăng nhập (kiểm tra token JWT)
    const token = localStorage.getItem("token");
    if (token) {
      axios
        .get("http://localhost:5000/api/users/me", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        })
        .then((response) => {
          setUser(response.data.user);
        })
        .catch((error) => {
          console.error("Error fetching user info:", error);
        });
    }
  }, []);

  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post("http://localhost:5000/api/auth/login", {
        email,
        password,
      });

      // Lưu token vào localStorage
      localStorage.setItem("token", response.data.token);
      setUser(response.data.user);
      setErrorMessage(""); // Reset error nếu đăng nhập thành công
    } catch (error) {
      setErrorMessage(error.response?.data?.message || "Lỗi hệ thống");
    }
  };

  useEffect(() => {
    // Lấy danh sách xe từ backend nếu người dùng đã đăng nhập
    if (user) {
      axios
        .get("http://localhost:5000/api/cars")
        .then((response) => {
          setCars(response.data);
        })
        .catch((error) => {
          console.error("Error fetching cars:", error);
        });
    }
  }, [user]);

  return (
    <div style={{ display: "flex", height: "100vh", width: "100vw" }}>
      {!user ? (
        // Hiển thị form đăng nhập nếu người dùng chưa đăng nhập
        <div style={{ flex: 1, display: "flex", justifyContent: "center", alignItems: "center" }}>
          <form onSubmit={handleLogin} style={{ padding: "20px", border: "1px solid #ccc", borderRadius: "8px" }}>
            <h2>Đăng Nhập</h2>
            <div>
              <label>Email:</label>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            <div>
              <label>Mật khẩu:</label>
              <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>
            <button type="submit">Đăng Nhập</button>
            {errorMessage && <p style={{ color: "red" }}>{errorMessage}</p>}
          </form>
        </div>
      ) : (
        <>
          {/* Phần hiển thị bản đồ */}
          <div style={{ flex: 1, height: "100%" }}>
            <MapComponent cars={cars} selectedCar={selectedCar} />
          </div>

          {/* Phần hiển thị danh sách xe */}
          <div
            style={{
              flex: 1,
              height: "100%",
              overflowY: "scroll",
              padding: "20px",
              borderLeft: "2px solid #ccc",
            }}
          >
            <h2>Danh sách xe</h2>
            {cars.map((car) => (
              <div
                key={car._id}
                style={{
                  padding: "10px",
                  border: "1px solid #ccc",
                  marginBottom: "10px",
                  cursor: "pointer",
                  backgroundColor: car.availability ? "#e0f7e0" : "#ffebee", // Màu nền tùy theo trạng thái xe
                }}
                onClick={() => setSelectedCar(car)}
              >
                <h3>{car.brand} {car.model}</h3>
                <p>{car.licensePlate}</p>
                {/* Hiển thị trạng thái xe */}
                <p style={{ fontWeight: "bold", color: car.availability ? "green" : "red" }}>
                  {car.availability ? "Có sẵn" : "Không có sẵn"}
                </p>
              </div>
            ))}
          </div>
        </>
      )}
    </div>
  );
}

export default App;
